import React,{Component} from 'react';
import{Link} from 'react-router-dom';
export default class Header extends Component{
    render(){
        let name=2;
        return(
            <div id='header'>
               <div className='header-Wid  clear'>
                   <div className='Wid-left'>
                        {name===2?<a href='javascript:;' className='iconfont icon-xitongcaidan'></a>:<Link to='' className='iconfont icon-back'></Link>}
                   </div>
                   <div className='Wid-Image'>
                        <img src={require('../img/logo.png')} alt=''/>
                   </div>
                   <div className='Wid-right'>
                        {name===2?<span>登录用户名</span>:<Link to='' className='iconfont icon-denglu'></Link>}
                   </div>
               </div>
            </div>
        )
    }
}
